import React from 'react';
import { IComment } from '../../types';

interface CommentItemProps {
  comment: IComment;
}

const CommentItem: React.FC<CommentItemProps> = ({ comment }) => {
  return (
    <li>
      <h3>{comment.name}</h3>
      <p>{comment.body}</p>
      <p><em>By: {comment.email}</em></p>
    </li>
  );
};

export default CommentItem;
